settings\u0004Note: To disable a context:
注意：要禁用上下文菜单项，
将其复制到用户首选项并添加「disabled」键。
下面的示例将禁用文件浏览器上下文菜单中的下载选项：
{
  "contextMenu": [
    {
      "command": "filebrowser:download",
      "selector": ".jp-DirListing-item[data-isdir=\"false\"]",
      "disabled": true
    }
  ]
}

上下文菜单描述：

settings\u0004Note: To disable a item,\n:
注意：要禁用一个项目，请将其复制到用户首选项中并添加“disabled”键。以下示例将禁用用户菜单：
{
  "toolbar": [
    {
      "name": "user-menu",
      "disabled": true
    }
  ]
}

顶栏描述：

settings\u0004Note: To disable a menu or:
注意：要禁用一个菜单或一个菜单项，
将其复制到用户选项并添加「disabled」键。
下面的示例将禁用「标签页」、「重启内核」以及「运行到所选单元格」项：
{
  "menus": [
    {
      "id": "jp-mainmenu-tabs",
      "disabled": true
    },
    {
      "id": "jp-mainmenu-kernel",
      "items": [
        {
          "command": "notebook:restart-and-run-to-selected",
          "disabled": true
        }
      ]
    }
  ]
}

菜单描述：

settings\u0004Note: To disable a toolbar:
注意：想要禁用一个工具栏项目，复制下面内容到用户选项并添加「disabled」键。下面的示例将会禁用中断按钮项目：
{
  "toolbar": [
    {
      "name": "interrupt",
      "disabled": true
    }
  ]
}

工具栏描述：

注意：想要禁用一个工具栏项目，复制下面内容到用户选项并添加「disabled」键。下面的示例将会禁用限位选择器项目：
{
  "toolbar": [
    {
      "name": "delimiter",
      "disabled": true
    }
  ]
}

工具栏描述：

注意：想要禁用一个工具栏项目，复制下面内容到用户选项并添加「disabled」键。下面的示例将会禁用刷新项目：
{
  "toolbar": [
    {
      "name": "refresh",
      "disabled": true
    }
  ]
}

工具栏描述：

注意：想要禁用一个工具栏项目，复制下面内容到用户选项并添加「disabled」键。下面的示例将会禁用上传按钮：
{
  "toolbar": [
    {
      "name": "interrupt",
      "disabled": true
    }
  ]
}

工具栏描述：

settings\u0004Overrides default widget p:
覆盖应用程序布局中的默认小部件位置，例如，在多文档模式下将终端放置在右侧边栏中，在单个文档模式下则放置在底部区域，{
  "single": { "Terminal": { "area": "down" } },
  "multiple": { "Terminal": { "area": "right" } }
}。
